package com.assignment.app;

public class Q8 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 int i = 5;
	        int j = 10;

	        System.out.println("Before interchange: i = " + i + ", j = " + j);

	        int temp = i;
	        i = j;
	        j = temp;

	        System.out.println("After interchange: i = " + i + ", j = " + j);

	}

}
